use test_app

drop table if exists #skins;
CREATE TABLE #skins (
avg_daily_volume INT,
avg_price_30_days FLOAT,
avg_price_30_days_raw FLOAT,
avg_price_7_days FLOAT,
avg_price_7_days_raw FLOAT,
current_price FLOAT,
current_price_last_checked VARCHAR(19),
img VARCHAR(142),
link VARCHAR(37),
market_name VARCHAR(33),
sm_url VARCHAR(95),
sold_last_24h INT,
sold_last_7d INT
);


select
	getdate() as DateCreate
,	s.img as Image
,	s.market_name as MarketHashName
,	(case 
		when s.current_price is not null then s.current_price
		when s.current_price is null then s.avg_price_30_days
	 end) as Price
,	null as StackCaseId
,	1 as Rarity
,	s.link as SteamAnalystUrl
,	s.sm_url as SteamUrl
from #skins s